import { VFC } from 'react';
import styled from "styled-components";

type HeaderIconLinkProps = {
    href: string,
    src: string,
    alt: string
}

export const HeaderIconLink:VFC<HeaderIconLinkProps> = ({href,src,alt})=> {
    return(
        <a href={href}><Styled_img src={src} alt={alt}></Styled_img></a>
    )
}

const Styled_img =styled.img`
    width:40px;
    height:40px;
    margin-right:7px;
    display: inline-block;
    padding: 8px 16px;
    text-decoration: none;
    background: black;
    color: #FFF;
    border-bottom: solid 3px #627295;
    border-radius: 3px;
    border-style: solid;
    border-color:white;
    border-width:100px;
    &:hober{
        background:orange;
`
